import * as URL from "../Const/URL";
const initialState = [];
fetch(URL.URL_GETUSERNAME, { method: "GET" })
    .then((Response) => Response.json)
    .then((data) => {
        console.log(data);
    });
export default (state = initialState, Action) => {
    switch (Action.type) {
        default:
            return state;
    }
};
